 body {
     margin: 0;
     font-family: Arial, sans-serif;
 }

 .container {
     display: grid;
     grid-template-columns: 1fr 3fr;
     grid-template-rows: auto 1fr auto;
     background: linear-gradient(145deg, #041117, #0a364a);
     height: 100vh;
 }

 .logo {
     width: 170px;
     margin-bottom: 120px;
 }

 .home-icon {
     display: flex;
     justify-content: left;
     margin-bottom: 12px;
 }

 .home-prop {
     height: 50px;
     width: 50px;
     margin-top: 20px;
     cursor: pointer;
     border-radius: 25px;
     /* Add an icon as the background image */
     background-image: url('https://energy-app.utech-iiot.lk/api/images/public/CT4OWEPgqkOvL4MeDMGyfT8HJlz2LP5U');
     /* Replace 'icon.png' with your icon's path */
     background-size: cover;
     /* Resize the image to cover the div */
     background-repeat: no-repeat;
     background-position: center;
     /* Center the icon inside the div */
 }

 .sidebar {
     background: linear-gradient(145deg, #041117, #0a364a);
     /*background: white;*/
     border-radius: 10px;
     padding: 20px;
     box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
     overflow-y: auto;
     font-family: Arial, sans-serif;
     max-width: 300px;
 }


 .sidebar h2 {
     margin: 0 0 10px 0;
     padding: 10px;
     font-size: 18px;
     background: #4caf50;
     color: white;
     border-radius: 5px;
     text-align: center;
     cursor: pointer;
     display: flex;
     align-items: center;
     justify-content: space-between;
 }

 .sidebar h2:after {
     content: '\25B6';
     font-size: 12px;
     transition: transform 0.3s;
 }

 .sidebar h2.open:after {
     transform: rotate(90deg);
 }

 .sidebar h2+ul {
     display: none;
     transition: all 0.3s ease-in-out;
 }

 .sidebar h2.open+ul {
     display: block;
 }

 .sidebar ul {
     list-style: none;
     background: lightblue;
     padding: 0;
 }


 .sidebar ul li {
     margin: 10px 0;
     position: relative;
 }


 .sidebar ul li ul {
     padding-left: 20px;
     margin-top: 5px;
     display: none;
     transition: all 0.3s ease-in-out;
 }


 .sidebar ul li span {
     cursor: pointer;
     display: flex;
     align-items: center;
     justify-content: space-between;
     font-size: 16px;
     font-weight: bold;
     color: #333;
 }

 .sidebar ul li span:after {
     content: '\25B6';
     font-size: 12px;
     transition: transform 0.3s;
 }

 .sidebar ul li.open>span:after {
     transform: rotate(90deg);
 }


 .sidebar ul li.open>ul {
     display: block;
 }


 .sidebar ul li ul li {
     font-size: 14px;
     margin: 5px 0;
     color: #555;
 }


 .sidebar ul li span:hover {
     color: #4caf50;
 }

 .sidebar ul li ul li:hover {
     color: #333;
     font-weight: bold;
 }

 .sidebar::-webkit-scrollbar {
     width: 8px;
 }

 .sidebar::-webkit-scrollbar-track {
     background: #e6e6e6;
     border-radius: 10px;
 }

 .sidebar::-webkit-scrollbar-thumb {
     background: #4caf50;
     border-radius: 10px;
 }

 .sidebar::-webkit-scrollbar-thumb:hover {
     background: #45a049;
 }

 .main-content {
     display: flex;
     flex-direction: column;
     align-items: left;
     justify-content: left;
 }

 .building-display img {
     width: 900px;
     height: 490px;
     /*justify-content: left;*/
 }

 .floor-buttons {
     margin-top: 20px;
 }

 .floor-buttons button {
     margin: 5px;
     padding: 10px 15px;
     background: #ddd;
     border: none;
     cursor: pointer;
 }

 .floor-buttons button:hover {
     background: #ccc;
 }

 .search-bar {
     grid-column: span 2;
     display: flex;
     align-items: center;
     justify-content: center;
     padding: 10px;
     background: linear-gradient(145deg, #041117, #0a364a);
 }

 .search-bar input {
     padding: 5px;
     width: 300px;
     border: 1px solid #ccc;
     border-radius: 3px;
 }

 .search-bar button {
     padding: 5px 10px;
     margin-left: 5px;
     background: #ddd;
     border: none;
     cursor: pointer;
 }

 .results {
     max-height: 300px;
     overflow-y: auto;
     border: 1px solid #ddd;
     border-radius: 5px;
     background: #ddd;
 }

 .result-item {
     padding: 10px;
     cursor: pointer;
 }

 .result-item:hover {
     background-color: #f0f0f0;
 }

 .device-status {
     display: flex;
     justify-content: space-around;
     align-items: center;
     padding: 20px;
     background: linear-gradient(145deg, #041117, #0a364a);
     border-top: 1px solid #ccc;
 }

 .online-icon-container {
